import { useState, useEffect, useMemo } from "react"
import MessageList from "../../component/MessageList"
import { Link, useNavigate } from "react-router-dom"

const Home = () => {
    const [data, setData] = useState()
    const navigate = useNavigate()

    useEffect(() => {

        const getData = async () => {
            try {
                const res = await fetch(`${process.env.REACT_APP_SERVERURL}/message`)
                const json = await res.json()
                setData(json.messages)
            } catch (err) {
                console.log(err)
            }
        }
        getData()

    }, [])

    const cachedMessages = useMemo(() => data, [data])

    const deletePhone =  async (id) => {
        try {
            await fetch(`${process.env.REACT_APP_SERVERURL}/message/${id}`, {
                method: "DELETE",
                headers: {
                    "Content-Type":"application/json"
                },
                body: JSON.stringify({ id })
            })

            const findId = cachedMessages?.filter(p => p.msg_id !== id)
            setData(findId)
            navigate(`/message/${data.msg_id}`, { replace: true })
        } catch (err) {
            console.log(err)
        }
    }

    return(
       <div className="responsive-table">

        <Link to='/register'>
            <button className="btn btn-dark mt-2">Register</button>
        </Link>
        <table className="table table-stripped mt-2">
            <thead className="table-dark">
                <tr>
                    <th>Celular</th>
                    <th>Status</th>
                    <th>#</th>
                    <th>#</th>
                </tr>
            </thead>
            <tbody>              
                {cachedMessages?.map((msg) => 
                <MessageList 
                key={msg.sms_id}
                msg={msg}
                deletePhone={deletePhone}
                />)}  
            </tbody>
        </table>
       </div>
    )
}

export default Home
